{/* ReactDOM.render(
    element,
    document.getElementById('root')
); */}

class Book extends Component {
    render() {
        return (
            <div>
                <p>Title is {this.props.title}</p>
                <p>Author is {this.props.author}</p>
            </div>
        )
    }
}

render(<Book title="The Selection" author="Kiera Cass" />, document.getElementById('root')); 

